import React, {Component} from 'react';
import './App.scss';
import Router from "./modules/router/Router";

class App extends Component {

    constructor(props: any) {
        super(props);
        if (window.location.pathname = '')
            window.location.href = '/login';
    }

    render() {
        return (
            <div>
                <Router/>
            </div>
        );
    }
}

export default App;
